        let currentPageIndex = 0;

        const pageImageElem = document.getElementById('page-image-elem');
        const pageTextElem = document.getElementById('page-text-elem');
        const prevButton = document.getElementById('prev-button');
        const nextButton = document.getElementById('next-button');
        const pageCounterElem = document.getElementById('page-counter-elem');

        function showPage(index) {
            const page = pages[index];
            pageImageElem.src = page.image;
            pageImageElem.alt = 'Illustration for: ' + page.text;
            pageTextElem.textContent = page.text;
            pageCounterElem.textContent = `Page ${index + 1} of ${pages.length}`;

            prevButton.disabled = index === 0;
            nextButton.disabled = index === pages.length - 1;
        }

        prevButton.addEventListener('click', () => {
            if (currentPageIndex > 0) {
                currentPageIndex--;
                showPage(currentPageIndex);
            }
        });

        nextButton.addEventListener('click', () => {
            if (currentPageIndex < pages.length - 1) {
                currentPageIndex++;
                showPage(currentPageIndex);
            }
        });

        // Show the first page initially
        showPage(currentPageIndex);
    </script>
